// File: contracts/cydreadz_mint_v1.sol

pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract CyDreadzMintContract is ERC721Enumerable, ERC2981, Ownable {
    using Strings for uint256;
    using SafeERC20 for IERC20;
    AggregatorV3Interface internal priceFeed;

    uint256 public version = 1;
    string public baseURI;
    string public baseExtension = ".json";
    uint256 public cost = 0.1 ether; // Change on DEPLOY !!
    uint256 public maxSupply = 2222;
    uint256 public maxMintAmount = 4;
    uint256 public maxPerWallet = 4;
    bool public wlStage = false;
    bool public paused = false;
    bool public revealed = true;
    bool public payMethod = true; // true: Native coin false: Stable(USDT) coin
    address public USDT = 0xBA62BCfcAaFc6622853cca2BE6Ac7d845BC0f2Dc;
    string public notRevealedUri;
    mapping(address => uint256) public mintCounter;
    address[] wlAddresses;

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _initBaseURI,
        string memory _initNotRevealedUri
    ) ERC721(_name, _symbol) {
        _setDefaultRoyalty(0x713AaEB4e7aA375343EA039C71D01790958cb26d, 1000); // 10%
        setBaseURI(_initBaseURI);
        setNotRevealedURI(_initNotRevealedUri);

        priceFeed = AggregatorV3Interface(
            0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
        );

        wlAddresses.push(owner());
    }

    function getLatestPrice() public view returns (int) {
        // prettier-ignore
        (
            /* uint80 roundID */,
            int price,
            /*uint startedAt*/,
            /*uint timeStamp*/,
            /*uint80 answeredInRound*/
        ) = priceFeed.latestRoundData();
        return price;
    }

    function setAddressesWL(address[] memory addresses_) public onlyOwner {
        for (uint256 i = 0; i < addresses_.length; i++) {
            wlAddresses.push(addresses_[i]);
        }
    }

    function setPayMethod(bool _newPayMethod) public onlyOwner {
        payMethod = _newPayMethod;
    }

    function isAddressWL(address addressesWL) public view returns (bool) {
        for (uint256 i = 0; i < wlAddresses.length; i++) {
            if (wlAddresses[i] == addressesWL) {
                return true;
            }
        }

        return false;
    }

    function getNumberOfWLAddresses() public view returns (uint256) {
        return wlAddresses.length;
    }

    function getWLAddress(uint256 i) public view returns (address) {
        return wlAddresses[i];
    }

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override(ERC721Enumerable, ERC2981) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function setDefaultRoyalty(
        address _receiver,
        uint96 _feeNumerator
    ) external onlyOwner {
        super._setDefaultRoyalty(_receiver, _feeNumerator);
    }

    function deleteDefaultRoyalty() external onlyOwner {
        super._deleteDefaultRoyalty();
    }

    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function remainingItems() public view returns (uint256) {
        return maxSupply - totalSupply();
    }

    function soldItems() public view returns (uint256) {
        return totalSupply();
    }

    function getUsdtAmount() public view returns (uint256) {
        int ethPrice = getLatestPrice();
        return cost * uint256(ethPrice) / (10 ** 8);
    }

    // public
    function mint(uint256 _mintAmount) public payable {
        uint256 supply = totalSupply();
        address buyerWalletAddress = _msgSender();
        require(!paused, "Mint is currently paused.");
        require(_mintAmount > 0, "Mint amount must be above 0.");
        require(_mintAmount <= maxMintAmount, "User exceeds max per TX.");
        require(
            mintCounter[buyerWalletAddress] + _mintAmount <= maxPerWallet,
            "User exceeds max per walletAddress."
        );
        mintCounter[buyerWalletAddress] =
            mintCounter[buyerWalletAddress] +
            _mintAmount;
        require(supply + _mintAmount <= maxSupply, "SOLD OUT.");

        if (buyerWalletAddress != owner()) {
            if (payMethod) {
                require(
                    msg.value >= cost * _mintAmount,
                    "Insufficient funds to mint."
                );
            } else {
                uint256 usdtAmount = getUsdtAmount();
                require(
                    IERC20(USDT).allowance(msg.sender, address(this)) >=
                        usdtAmount * _mintAmount,
                    "Invalid Allow"
                );
                IERC20(USDT).safeTransfer(address(this), usdtAmount * _mintAmount);
            }
        }

        if (wlStage) {
            require(isAddressWL(buyerWalletAddress), "Not whitelisted");
        }

        for (uint256 i = 1; i <= _mintAmount; i++) {
            _safeMint(buyerWalletAddress, supply + i);
        }
    }

    function walletOfOwner(
        address _owner
    ) public view returns (uint256[] memory) {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIds;
    }

    function tokenURI(
        uint256 tokenId
    ) public view virtual override returns (string memory) {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        if (revealed == false) {
            return notRevealedUri;
        }

        string memory currentBaseURI = _baseURI();
        return
            bytes(currentBaseURI).length > 0
                ? string(
                    abi.encodePacked(
                        currentBaseURI,
                        tokenId.toString(),
                        baseExtension
                    )
                )
                : "";
    }

    //only owner
    function reveal() public onlyOwner {
        revealed = true;
    }

    function setCost(uint256 _newCost) public onlyOwner {
        cost = _newCost;
    }

    function setMaxPerWallet(uint256 _newMaxPerWallet) public onlyOwner {
        maxPerWallet = _newMaxPerWallet;
    }

    function setMaxMintAmount(uint256 _newMaxMintAmount) public onlyOwner {
        maxMintAmount = _newMaxMintAmount;
    }

    function setNotRevealedURI(string memory _notRevealedURI) public onlyOwner {
        notRevealedUri = _notRevealedURI;
    }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function setBaseExtension(
        string memory _newBaseExtension
    ) public onlyOwner {
        baseExtension = _newBaseExtension;
    }

    function pause(bool _state) public onlyOwner {
        paused = _state;
    }

    function setWLStage(bool _state) public onlyOwner {
        wlStage = _state;
    }

    function withdraw() public onlyOwner {
        (bool os, ) = payable(owner()).call{value: address(this).balance}("");
        require(os);
    }
}
